                sessionType: 'RX',
                syncDirectory: '/home/Kappa',
                syslogIP: '0.0.0.0',
                snmpIP: '0.0.0.0'
              }
            ]
          }
      }
    componentDidMount() 
    {
        //This method will ask server for stats.
    }

    render(){
        console.log("Arriving here");
        return( <h1>This page will show stats of smart channel service</h1> )
    }
}
